import React from 'react';

import Housing from '../Data/logements.json';

function Card() {
    return(
        <div>
            {Housing.map((item)=>(
                 <Card
                 key={item.id}
                 id={item.id}
                 cover={item.cover}
                 title={item.title}

                ></Card>


            ) )}
        </div>
    )

}
export default Card
